// src/components/Contacto.js
import React from 'react';
import './Contacto.css'; // Asegúrate de importar el CSS

const Contacto = () => {
  return (
    <div className="Contacto">
      <h1>Contáctanos</h1>
      <p>Nombre de la Empresa: International Express</p>
      <p>Número de contacto: 000003572937</p>
      <p>Correo electrónico: <a href="mailto:Interexpress@excomp.com">Interexpress@excomp.com</a></p>
    </div>
  );
};

export default Contacto;
